CREATE TABLE iris_scans (
    id INT PRIMARY KEY,
    iris_data BYTES,
    scan_date TIMESTAMP
);

CREATE TABLE backups (
    backup_id UUID PRIMARY KEY,
    backup_date TIMESTAMP,
    backup_data BYTES
);

CREATE TABLE users (
    id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    iris_scan_data BYTEA NOT NULL
);

CREATE TABLE backups (
    backup_id INT PRIMARY KEY,
    backup_date TIMESTAMP NOT NULL,
    backup_data BYTEA NOT NULL
);

CREATE TABLE backup_logs (
    log_id INT PRIMARY KEY,
    backup_id INT REFERENCES backups(backup_id),
    backup_status VARCHAR(20) NOT NULL,
    backup_timestamp TIMESTAMP NOT NULL
);

CREATE TABLE backup_history (
    history_id INT PRIMARY KEY,
    backup_id INT REFERENCES backups(backup_id),
    backup_successful BOOLEAN NOT NULL,
    backup_duration INTERVAL NOT NULL
);

CREATE TABLE admin_users (
    admin_id INT PRIMARY KEY,
    admin_username VARCHAR(50) NOT NULL,
    admin_password VARCHAR(50) NOT NULL
);
